import React from 'react';
import udiliaLogo from './udilia-logo.svg';
import './Example.css';

const Example = () => (
  <div className="Example">
    <img src={udiliaLogo} alt="React logo" width="62" />
    <h1 className="Example-text">Create React Library</h1>
  </div>
);

export default Example;
